import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { createBrowserRouter } from 'react-router-dom';

const router = createBrowserRouter([
  {
    "path": "/",
    "element": <FirstPage />
  },
  {
    "path": "/quiz",
    "element": <QuizPage />
  }
])

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <App />
);
